import React from 'react';
import '../styles/LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing">
      <h1>CEREBRO</h1>
      <p>Untethered Ideation. Transform Chats to Tasks.</p>
      <button className="start-btn">GET STARTED</button>
    </div>
  );
};

export default LandingPage;
